import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: "kevin",
        },
        {
          name: "robert",
        },
        {
          name: "gaston",
        },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map(monster=> <h3>{monster.name}</h3>)
        }
      </div>
    );
  }
}

export default App;
